import React from 'react';

const ShowTodoList = ({ todos }) => {
  console.log('Tareas recibidas en ShowTodoList:', todos); // Verifica si todos contiene datos

  if (!todos || todos.length === 0) {
    return <p>No hay tareas disponibles.</p>;
  }

  return (
    <div>
      <h2>Lista de Tareas</h2>
      <ul>
        {todos.map((todo) => (
          <li key={todo._id}>
            <h3>{todo.title}</h3>
            <p>{todo.description}</p>
            <p>Prioridad: {todo.priority}</p>
            <p>Fecha: {new Date(todo.date).toLocaleDateString()}</p>
            <p>{todo.done ? "Completada" : "Pendiente"}</p>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ShowTodoList;
